import {
  dashboardRequest,
  dashboardSuccess,
  dashboardFailed,
} from "./store/actions";
import {
  formData,
  formRequest,
  formSuccess,
  formFailed,
  formRest,
} from "../Form/store/actions";
import { ApplicationState } from "../../stores/index";
import { Dashboard } from "./Dashboard";
import { connect } from "react-redux";

const mapStateToProps = (props: ApplicationState) => {
  return {
    dashboardReducer: props.dashboardReducer,
    formReducer: props.formReducer,
  };
};

const mapStateToDispatch = {
  dashboardRequest,
  dashboardSuccess,
  dashboardFailed,
  formData,
  formRequest,
  formSuccess,
  formFailed,
  formRest,
};

export default connect(mapStateToProps, mapStateToDispatch)(Dashboard);
